import logo from "./logo.svg";
import "./App.css";
import Header from "./components/Header";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div className="app-wrapper">
      <Header/>
      <Navbar/>
      <div className="content">
        <div className="main-image">
          <img src="https://indepth-wellness.com/wp-content/uploads/2017/01/banner-7-1200-x-400.jpg"></img>
        </div>
        <div>
          Ava + description
        </div>
        <div>
          My posts
          <div>
            New post
          </div>
          <div>
            post1
          </div>
          <div>
            post2
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
